import z1 from "../../images/zacisk1.JPG";
import z2 from "../../images/zacisk2.JPG";
import f from "../../images/rf.jpg";
import mp from "../../images/DSCN0076.JPG";
import s from "../../images/sil.jpg";
import b from "../../images/b.jpg";
import { List, SingleTile, Text, TilesNav } from "./styled";

export const Tile = () => {
  return <></>;
};

export const Tiles = () => {
  return (
    <TilesNav>
      <List>
        <SingleTile bg={z1}  bgHover={z2}><Text>Malowanie proszkowe</Text></SingleTile>
        <SingleTile bg={f}><Text>Renowacja felg & CNC</Text></SingleTile>
              <SingleTile bg={b}><Text>Wynajem</Text></SingleTile>
      </List>
    </TilesNav>
  );
};
